/* eslint-disable @typescript-eslint/no-explicit-any */
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import { InvoiceData } from "../types/invoice";
import { formatNumber } from ".";
import { convertNumberToWords } from "../utils";

export const generateInvoicePDF = (
  invoiceData: InvoiceData,
  printType: string
) => {
  const doc = new jsPDF();

  const qr =
    "";

  const logoBase64 =
    "";

  let bankTableY = (doc as any).autoTable.previous.finalY + 0;
  doc.setFillColor(235, 235, 235); // Tomato color or any RGB
  doc.rect(163, 8, 30, 6, "F"); // x, y, width, height, "F" for filled rectangle
  doc.setTextColor(0, 0, 0);
  doc.setFontSize(8);
  doc.text(`${invoiceData?.invoiceType}`, 178, 12, { align: "center" });
  // doc.setFillColor(235, 235, 235);
  // doc.rect(149, 10, 54, 8, "F"); // x, y, width, height, "F" for filled rectangle
  doc.setTextColor(0, 0, 0);
  doc.setFontSize(8);
  doc.setFont("helvetica", "italic");
  doc.text(`${printType}`, 178, 18, { align: "center" });

  // Reset text color if needed later
  doc.setTextColor(0, 0, 0);
  // Reset text color if needed later
  doc.setTextColor(0, 0, 0);
  doc.addImage(logoBase64, "PNG", 13, 10, 25, 34);
  // Header Section
  doc.setFontSize(10);
  doc.text("KULAJA PRAHANAME NAMAHA", 105, 10, { align: "center" });
  doc.setFontSize(39);
  doc.setFont("helvetica", "medium");
  doc.text("Abirami Enterprises", 105, 30, { align: "center" });
  doc.setFontSize(14);
  doc.text("Quality Motor & Pump Spares", 105, 37, { align: "center" });
  doc.setFontSize(9);
  doc.text(
    "Address: 1052, Bharathiyar Road, P.N.Palayam, Coimbatore 641 037, Tamil Nadu, India",
    105,
    42,
    { align: "center" }
  );
  doc.text(
    "Contact: 94434-20311 | 98947  84435 | Email ID:cbeabiramienterprises@gmail.com",
    105,
    46,
    { align: "center" }
  );
  doc.setFontSize(15);
  doc.text("GST NO: 33ACVPC9001G1ZS", 105, 16, { align: "center" });

  // Sender & Receiver Details Table
  autoTable(doc, {
    startY: 50,
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    body: [
      [
        "M/S",
        {
          content: invoiceData?.clientName || "",
          styles: { fontStyle: "bold" },
        },
        "Date",
        { content: invoiceData?.date || "", styles: { fontStyle: "bold" } },
      ],
    ],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 2,
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
      minCellWidth: 30,
      textColor: 0,
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: 0,
      fontStyle: "bold",
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
    },
    columnStyles: {
      0: { cellWidth: 40 }, // "GST"
      1: { cellWidth: 60 }, // GST Value
      2: { cellWidth: 40 }, // Transport, PO No, etc.
      4: { cellWidth: 60 }, // "GST"
    },
  });
  autoTable(doc, {
    startY: (doc as any).autoTable.previous.finalY + 0,
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    body: [
      [
        `${invoiceData?.client?.addressLine1 || ""} ${
          invoiceData?.client?.addressLine2 || ""
        } ${invoiceData?.client?.addressLine3 || ""} ${invoiceData?.client?.city || ""} ${invoiceData?.client?.state || ""} ${invoiceData?.client?.pincode || ""}`,
        "Invoice Number",
        {
          content: invoiceData?.invoiceId,
          styles: { fontStyle: "bold", minCellWidth: 30 },
        },
      ],
    ],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 2,
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
      minCellWidth: 30,
      textColor: 0,
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: 0,
      fontStyle: "bold",
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
    },
    columnStyles: {
      0: { cellWidth: 100 }, // "GST"
      1: { cellWidth: 40 }, // GST Value
      2: { cellWidth: 60 }, // Transport, PO No, etc.
    },
    tableWidth: "auto",
  });
  const isTaxInvoice =
    invoiceData?.invoiceType?.toLowerCase() === "tax invoice";
  autoTable(doc, {
    startY: (doc as any).autoTable?.previous?.finalY || 10,
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    body: [
      [
        {
          content: "GST",
          rowSpan: isTaxInvoice ? 4 : 1,
          styles: { valign: "top", fontStyle: "bold" },
        },
        {
          content: invoiceData?.client?.GST || "",
          rowSpan: isTaxInvoice ? 4 : 1,
          styles: { valign: "top", fontStyle: "bold" },
        },
        ...(isTaxInvoice
          ? [
              {
                content: `Transport: ${invoiceData?.transport || ""}`,
                styles: { minCellWidth: 70 },
              },
            ]
          : []),
      ],
      ...(isTaxInvoice
        ? [
            [
              {
                content: `Place of Supply: ${invoiceData?.placeOfSupply || ""}`,
                styles: { minCellWidth: 70 },
              },
            ],
            [
              {
                content: `PO No: ${invoiceData?.poNO || ""}`,
                styles: { minCellWidth: 70 },
              },
            ],
            [
              {
                content: `Vehicle No: ${invoiceData?.vehicleNo || ""}`,
                styles: { minCellWidth: 70 },
              },
            ],
          ]
        : []),
    ],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 2,
      lineWidth: 0.3,
      lineColor: [0, 0, 0],
      textColor: 0,
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: 0,
      fontStyle: "bold",
      lineWidth: 0.3,
      lineColor: [0, 0, 0],
    },
    columnStyles: {
      0: { cellWidth: 40 }, // GST Label
      1: { cellWidth: 60 }, // GST Value
      2: { cellWidth: 100 }, // Transport and related details
    },
  });

  autoTable(doc, {
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    startY: (doc as any).autoTable.previous.finalY + 0,
    body: [
      [
        "Contact ",
        {
          content: invoiceData?.client?.mobileNum || "",
          styles: { minCellWidth: 50 },
        },
        "State",
        { content: invoiceData?.state || "", styles: { fontStyle: "bold" } },
        "Code",
        { content: invoiceData?.code || "", styles: { fontStyle: "bold" } },
      ],
    ],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 2,
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
      textColor: 0,
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: 0,
      fontStyle: "bold",
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
    },
    columnStyles: {
      0: { cellWidth: 40 },
      1: { cellWidth: 60 },
      2: { cellWidth: 20 },
      3: { cellWidth: 40 },
      4: { cellWidth: 20 },
      5: { cellWidth: 20 },
    },
  });

  // Items Table
  autoTable(doc, {
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    startY: (doc as any).autoTable.previous.finalY + 0,
    head: [
      [
        "S.No",
        "Description",
        "HSN No.",
        "Quantity",
        "Rate",
        "Discount",
        "Amount",
      ],
    ],
    body:
      invoiceData?.productDetails?.map((item, index) => [
        index + 1,
        item?.description,
        item?.HSNno,
        item?.quantity,
        item?.rate,
        `${item?.discount} %`,
        item?.amount,
      ]) || [],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 2,
      lineWidth: 0.3, // Ensures visible borders for actual data
      lineColor: [0, 0, 0],
      textColor: 0,
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: 0,
      fontStyle: "bold",
      lineWidth: 0.3, // Ensures visible borders for headers
      lineColor: [0, 0, 0],
    },
    columnStyles: {
      0: { cellWidth: 13 },
      1: { cellWidth: 67 },
      2: { cellWidth: 25 },
      3: { cellWidth: 20 },
      4: { cellWidth: 25 },
      5: { cellWidth: 25 },
      6: { cellWidth: 25 },
    },
  });

  // Ensure a minimum table height of 200
  const finalY = (doc as any).autoTable.previous.finalY;
  if (finalY < 200) {
    autoTable(doc, {
      startY: finalY,
      margin: { top: 0, right: 5, bottom: 0, left: 5 },
      body: Array.from({ length: Math.ceil((200 - finalY) / 10) }, () => [
        "",
        "",
        "",
        "",
      ]),
      theme: "plain", // Removes the grid theme
      styles: { fontSize: 10, cellPadding: 2, lineWidth: 0 }, // Invisible lines
    });
  }

  const bankTableHeight = 60; // Adjust based on your QR size and cell padding
  const pageHeight = doc.internal.pageSize.height;
  const currentY = (doc as any).autoTable.previous.finalY + 5;

  // If the bank table won't fit, add a new page
  if (currentY  > 200) {
    doc.addPage();
    bankTableY = 20; // Reset Y position on new page
  } else {
    bankTableY = currentY;
  }

  autoTable(doc, {
    startY: bankTableY,
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    body: [
      [
        // TERMS & CONDITIONS on the left spanning multiple rows
        {
          content:
            `TERMS & CONDITIONS:\n\n1. Goods once sold will not be taken back under any circumstances.\n\n2. We are not responsible for any loss or damage of goods in transit. `, 
          styles: {
            halign: "left",
            fontStyle: "bold",
            minCellWidth: 29.5,
            fontSize: 7,
            cellPadding: 2,
            textColor: 0,
          },
          rowSpan: 3,
        },
        { content: "Sub Total", styles: { fontStyle: "bold" } },
        formatNumber(invoiceData?.subTotal ?? 0),
      ],
      [
        {
          content:
            invoiceData?.taxType === "IGST"
              ? "IGST @ 18%"
              : "CGST @ 9% & SGST @ 9%",
          styles: { fontStyle: "bold" },
        },
        formatNumber(invoiceData?.taxGST ?? 0),
      ],
      [
        { content: "PF Amount", styles: { fontStyle: "bold" } },
        formatNumber(invoiceData?.pfAmount ?? 0),
      ],

      [
        {
          content: `In Words:\n\n ${convertNumberToWords(
            invoiceData?.totalAmount ?? 0
          )} Only`,
          styles: { halign: "left", fontStyle: "bold", minCellHeight: 10 },
          rowSpan: 2, // Spanning across all columns
        },
        { content: "Round Off", styles: { fontStyle: "bold" } },
        formatNumber(invoiceData?.roundOff ?? 0),
      ],
      [
        { content: "Grand Total", styles: { fontStyle: "bold" } },
        formatNumber(invoiceData?.totalAmount ?? 0),
      ],
    ],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 1,
      minCellHeight: 5,
      lineWidth: 0.3, // Ensures visible borders
      lineColor: [0, 0, 0],
      minCellWidth: 29.5,
    },
    columnStyles: {
      0: { cellWidth: 120 }, // GST Label
      1: { cellWidth: 40 }, // GST Value
      2: { cellWidth: 40 }, // Transport and related details
    },
  });

  autoTable(doc, {
    startY: (doc as any).autoTable?.previous?.finalY ,
    margin: { top: 0, right: 5, bottom: 0, left: 5 },
    body: [
      [
        {
          content:
            "Bank Name : State Bank of India\nBank A/c No. : 56334000041\nIFSC Code : SBIN0070319\nBranch : Avinashi Road, Coimbatore -37",
          rowSpan: 5,
        },
        {
          content: "", // QR Code will be drawn via `didDrawCell`
          rowSpan: 5,
        },
        {
          content: `Cheque No: ${invoiceData?.chequeNumber || ""}`,
          styles: { minCellWidth: 70 },
        },
      ],
      [
        {
          content: `Date: ${invoiceData?.date || ""}`,
          styles: { minCellWidth: 70 },
        },
      ],
      [
        {
          content: `Bank name: ${invoiceData?.bankName || ""}`,
          styles: { minCellWidth: 70 },
        },
      ],
      [
        {
          content: `Cheque Amount: ${invoiceData?.chequeAmount || ""}`,
          styles: { minCellWidth: 70 },
        },
      ],
    ],
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 2,
      lineWidth: 0.3,
      lineColor: [0, 0, 0],
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: 0,
      fontStyle: "bold",
      lineWidth: 0.3,
      lineColor: [0, 0, 0],
    },
    didDrawCell: (data) => {
      if (
        data.section === "body" &&
        data.row.index === 0 &&
        data.column.index === 1
      ) {
        doc.addImage(qr, "PNG", data.cell.x + 5, data.cell.y + 1, 30, 30);
      }
    },
    columnStyles: {
      0: { cellWidth: 70 }, // GST Label
      1: { cellWidth: 50 }, // GST Value
      2: { cellWidth: 80 }, // Transport and related details
    },
  });
  const lastTableY = (doc as any).autoTable?.previous?.finalY ;
  doc.setFontSize(10);
  doc.setFont("helvetica", "bold");
  doc.text("For ABIRAMI ENTERPRISES", 175, lastTableY + 16, { align: "center" });
  const pageCount = doc.getNumberOfPages();
  for (let i = 1; i <= pageCount; i++) {
    doc.setPage(i);
    doc.setDrawColor(0); // Black border
    doc.setLineWidth(0.5); // Thin border
    doc.rect(5, 5, doc.internal.pageSize.getWidth() - 10, doc.internal.pageSize.getHeight() - 10); // Draw border with margin
  }
  // Save the PDF
  doc.save(`${invoiceData?.clientName} _ ${invoiceData?.invoiceId}.pdf`);
};
